import React from 'react';
import "../App.css";
export default class ScoreCard extends React.Component
{
    state={
        tosses:0,
        heads:0,
        tails:0,
        current:"Ready to Flip!!",
        imgSRC:"data:image/png;base64,"
    }


    headsURL="data:image/jpeg;base64,"



    tailsURL="data:image/jpeg;base64,"
    ChangeFunc()
    {
        var selector=Math.floor(Math.random()*10)%2
        console.log("change",selector)
        if(selector===1)
        {
            this.setState({
                current:"Tails!!",
                imgSRC: this.tailsURL,
                tosses:this.state.tosses+1,
                tails:this.state.tails+1
            })
        }
        else
        {
            this.setState({
                current:"Heads!!",
                imgSRC: this.headsURL,
                tosses:this.state.tosses+1,
                heads:this.state.heads+1
            })
        }
    }
    render()
    {
        return(
            <div>
                <table className="TableDIV">
                    <thead>
                        <tr>
                            <th>Number of Flips</th>
                            <th>Heads</th>
                            <th>Tails</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{this.state.tosses}</td>
                            <td>{this.state.heads}</td>
                            <td>{this.state.tails}</td>
                        </tr>
                    </tbody>
                </table>
                <button className="ChangeButton" onClick={() => this.ChangeFunc()}>Flip the Coin</button>
                <h3>{this.state.current}</h3>
                <img className="Coin_Image" src={this.state.imgSRC} />
            </div>
        )
    }
}
